import Staff from "./containers/Staffs/Staff";
import Movies from "./containers/Movies/Movies";
export const navMenu = [
    {
        id: '1',
        name: 'Tổng quan',
        route: '/total',
        Comp: Movies,
        role: ['staff', 'admin']
    },
    {
        id: '2',
        name: 'Nhân viên',
        route: '/staff',
        Comp: Staff,
        role: ['admin']
    },
    {
        id: '3',
        name: 'Hoá đơn',
        route: '/receipt',
        Comp: Staff,
        role: ['admin']
    },
    {
        id: '4',
        name: 'Phim',
        route: '/movie',
        Comp: Staff,
        role: ['admin']
    },
    {
        id: '5',
        name: 'Suất chiếu',
        route: '/session',
        Comp: Staff,
        role: ['admin']
    },
    {
        id: '6',
        name: 'Thể loại phim',
        route: '/cateogry',
        Comp: Staff,
        role: ['admin']
    },
    {
        id: '7',
        name: 'Rạp phim',
        route: '/cinema',
        Comp: Staff,
        role: ['admin']
    }
]
